import React from 'react';
import signo from '../signo.png';
import quotes from '../quotes.json';
import {useState} from 'react';


const Tarjeta = () => {
    const [frase, setFrase]= useState(quotes[0]);
    const clik = ()=>{
        return setFrase(Math.floor(Math.random()*quotes.length)); }
    return (
        <div>
            <p>{frase}</p>
            <button onClick={clik}><img src={signo}></img>
            </button>
        </div>
    );
};

export default Tarjeta;
